import React from 'react';

function Header() {
  return (
    <header>
      <h1>Instant Diaries</h1>
      
      <nav className="navigation">
        <a href="#home">Home</a>
        <a href="#about">About</a>
        <a href="#services">Services</a>
        <a href="#gallery">Gallery</a>
        <a href="#contact">Contact</a>
      </nav>
    </header>
  );
}

export default Header;
